  //   { title: 'hello '},
  //   { title: 'hello '},
  //   { title: 'hello '},
  //   { title: 'hello '},
  //   { title: 'hello '},
  //   { title: 'hello '},
  //   { title: 'hello '},
  //   { title: 'hello '},
  //   { title: 'hello '},
  //   { title: 'hello '},
  // ];

  return (
    <div className="journal">
      {journal !== "" &&
        journal.map((entry, i) => (
          <Link key={i} to={`/Journal/${i}`}>
            <div key={i}>{entry.title}</div>
          </Link>
        ))}
      {/* {test.map((entry, i) => (
        <div key={i}>{entry.title}</div>
      ))} */}
    </div>
  );
};

export default Journal;
